DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` integer NOT NULL AUTO_INCREMENT,
  `username` varchar(255) UNIQUE,
  `password` varchar(255),
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `active` boolean DEFAULT 1,
  PRIMARY KEY (`id`) USING BTREE
);


DROP TABLE IF EXISTS `place`;
CREATE TABLE `place` (
  `id` integer NOT NULL AUTO_INCREMENT,
  `name` varchar(255),
  `address` text,
  `description` text,
  `user_id` integer,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `active` boolean DEFAULT 1,
  PRIMARY KEY (`id`) USING BTREE,
  CONSTRAINT `fk_user_id` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
);



DROP TABLE IF EXISTS `friend`;
CREATE TABLE `friend` (
  `id` integer NOT NULL AUTO_INCREMENT,
  `source_friend_id` integer,
  `target_friend_id` integer,
  `status` ENUM ('waiting', 'accepted', 'rejected'),
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `active` boolean DEFAULT 1,
  PRIMARY KEY (`id`) USING BTREE,
  CONSTRAINT `fk_source_friend_id` FOREIGN KEY (`source_friend_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_target_friend_id` FOREIGN KEY (`target_friend_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
);


DROP TABLE IF EXISTS `tag`;
CREATE TABLE `tag` (
  `id` integer NOT NULL AUTO_INCREMENT,
  `place_id` integer,
  `friend_id` integer,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `friend_notification` boolean DEFAULT 0,
  `liked` boolean DEFAULT 0,
  `active` boolean DEFAULT 1,
  PRIMARY KEY (`id`) USING BTREE,
  CONSTRAINT `fk_tag_place_id` FOREIGN KEY (`place_id`) REFERENCES `place` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `fk_friend_id` FOREIGN KEY (`friend_id`) REFERENCES `user` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
);


